import React from "react";
import { HelpBlock, FormGroup, FormControl, Button} from 'react-bootstrap';

let ControlLabel = "Message"

function FieldGroup({ id, label, help, ...props }) {
  return (
    <FormGroup controlId={id}>
      <ControlLabel>{label}</ControlLabel>
      <FormControl {...props} />
      {help && <HelpBlock>{help}</HelpBlock>}
    </FormGroup>
  );
}

const Contact = () => {
  return (
    <div>
      <h1 className="header">Contact Me</h1>
      <a href="https://www.linkedin.com/in/anclark686/" target="_blank" rel="noreferrer">LinkedIn</a>
      <br />
      <a href="mailto:anclark686@gmail.com" target="_blank" rel="noreferrer">Email Me</a>

      <form>
    <FieldGroup
      id="formControlsText"
      type="text"
      label="Name"
      placeholder="Enter name"
    />
    <FieldGroup
      id="formControlsEmail"
      type="email"
      label="Email address"
      placeholder="Enter email"
    />

    <FormGroup controlId="formControlsTextarea">
      <ControlLabel>Message</ControlLabel>
      <FormControl componentClass="textarea" placeholder="Message" />
    </FormGroup>


    <Button type="submit">Submit</Button>
  </form>

    </div>
  );
};

export default Contact;
